export default (function(a,b,c,d,e,f,g,h,i){return {data:{WXO2gjv7HY:{data:{id:1271,attributes:{imdbId:"tt0452623",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BYmM2NDNiNGItMTRhMi00ZDA2LTgzOWMtZTE2ZjFhMDQ2M2U5XkEyXkFqcGdeQXVyNTAyODkwOQ@@._V1_SX300.jpg",type:"movie",ratings:[{Source:"Internet Movie Database",Value:"7.6\u002F10"},{Source:"Rotten Tomatoes",Value:"94%"},{Source:"Metacritic",Value:"72\u002F100"}],item_lang:{data:{id:1934,attributes:{title:"Gone Baby Gone",plot:"When 4 year old Amanda McCready disappears from her home and the police make little headway in solving the case, the girl's aunt Beatrice McCready hires two private detectives Patrick Kenzie and Angie Gennaro. The detectives freely admit that they have little experience with this type of case, but the family wants them for two reasons - they're not cops and they know the tough Boston neighborhood in which they all live. As the case progresses, Kenzie and Gennaro face drug dealers, gangs and pedophiles. When they are about to solve their case, they are faced with a moral dilemma that could tear them apart.",slug:"gone-baby-gone"}}},books:{data:[{id:6986,attributes:{title:e,description:f,thumbnail:g,authors:[a],firstBook:true,published:h,publisher:b,subtitle:i}},{id:6987,attributes:{title:"Gone, baby, gone",description:"Patrick kenzie et angela gennaro, les deux héros de dennis lehane, sont chargés de retrouver une petite fille de quatre ans, amanda, mystérieusement disparue un soir d’automne. Curieusement, la mère d’amanda paraît peu concernée par ce qui est arrivé à sa fille, qu’elle avait laissée seule le soir du drame pour aller dans un bar. Sa vie semble régie par la télévision, l’alcool et la drogue. Patrick et angie découvrent d’ailleurs que la jeune femme dealait pour le compte d’un dénommé cheddar olamon et qu’elle aurait détourné les deux cent mille dollars de sa dernière livraison. Olamon se serait-il vengé en kidnappant la fille de son «employée» ? Cette quatrième aventure de kenzie et gennaro distille une petite musique déchirante et se termine par une chute aussi inattendue que bouleversante.Gone, baby, gone vient d’être porté à l’écran par ben affleck avec casey affleck, michelle monaghan, morgan freeman et ed harris.",thumbnail:d,authors:[a],firstBook:c,published:"2007-01-01",publisher:"Rivages",subtitle:d}},{id:6988,attributes:{title:e,description:f,thumbnail:g,authors:[a],firstBook:c,published:h,publisher:b,subtitle:i}},{id:6989,attributes:{title:"Gone, Baby, Gone with Bonus Content",description:"The tough neighborhood of Dorchester is no place for the innocent or the weak. A territory defined by hard heads and even harder luck, its streets are littered with the detritus of broken families, hearts, dreams. Now, one of its youngest is missing. Private investigators Patrick Kenzie and Angela Gennaro don't want the case. But after pleas from the child's aunt, they open an investigation that will ultimately risk everything—their relationship, their sanity, and even their lives—to find a little girl-lost.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=LC6iZsMxUpoC&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[a],firstBook:c,published:"2010-11-01",publisher:b,subtitle:d}},{id:6990,attributes:{title:"Moonlight Mile",description:"“[Lehane has] emerged from the whodunit ghetto as a broader and more substantial talent....When it comes to keeping readers exactly where he wants them, Mr. Lehane offers a bravura demonstration of how it’s done.” —New York Times Moonlight Mile is the first Patrick Kenzie and Angela Gennaro suspense novel in more than a decade from the acclaimed, New York Times bestselling master of the new noir, Dennis Lehane. An explosive tale of vengeance and redemption—the brilliant sequel to Gone, Baby, Gone—Moonlight Mile returns Lehane’s unforgettable and deeply human detective duo to the mean streets of blue collar Boston to investigate the second disappearance of Amanda McCready, now sixteen years old. After his remarkable success with Mystic River, Shutter Island, and The Given Day, the celebrated author whom the Washington Post praises as, “one of those brave new detective stylists who is not afraid of fooling around with the genre’s traditions,” returns to his roots—and the result, as always, is electrifying.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=KFjw5b7DP_UC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[a],firstBook:c,published:"2010-11-02",publisher:b,subtitle:"A Kenzie and Gennaro Novel"}}]}}},meta:{}}},prerenderedAt:1680940980139}}("Dennis Lehane","Harper Collins",null,"","Gone, Baby, Gone","“Powerful and raw, harrowing, and unsentimental.” —Washington Post Book World “Chilling, completely credible….[An] absolutely gripping story.” —Chicago Tribune “Mr. Lehane delivers big time.” —Wall Street Journal In Gone, Baby, Gone, the master of the new noir, New York Times bestselling author Dennis Lehane (Mystic River, Shutter Island), vividly captures the complex beauty and darkness of working-class Boston. A gripping, deeply evocative thriller about the devastating secrets surrounding a little girl lost, featuring the popular detective team of Patrick Kenzie and Angela Gennaro, Gone, Baby, Gone was the basis for the critically acclaimed motion picture directed by Ben Affleck and starring Casey Affleck, Ed Harris, and Morgan Freeman.","https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=a0He4Alb3ZIC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api","2009-10-13","A Novel"))